import React, { Component } from 'react'
import NavButton from './NavButton/NavButton'

class NavBar extends Component {

    render() {

        const style = {
            columnCount: 3,
            leftMargin: '100%',
            rightMargin: '100%'
        }

    return (
        <div style={style}>
            <NavButton name="Education" handlePageChange={this.props.handlePageChange}/>
            <NavButton name="Projects" handlePageChange={this.props.handlePageChange}/>
            <NavButton name="Contact" handlePageChange={this.props.handlePageChange}/>
        </div>
    )

    }

}

export default NavBar;
